function stm_isotope_sort_function(currentChoice) {
    var $ = jQuery;
    var stm_choice = currentChoice;
    var $container = $('.stm-isotope-sorting');
    switch (stm_choice) {
        case 'price_low':
            $container.isotope({
                getSortData: {
                    price: function(itemElem) {
                        var price = $(itemElem).data('price');
                        return parseFloat(price);
                    }
                },
                sortBy: 'price',
                sortAscending: true
            });
            break;
        case 'price_high':
            $container.isotope({
                getSortData: {
                    price: function(itemElem) {
                        var price = $(itemElem).data('price');
                        return parseFloat(price);
                    }
                },
                sortBy: 'price',
                sortAscending: false
            });
            break;
        case 'date_low':
            $container.isotope({
                getSortData: {
                    date: function(itemElem) {
                        var date = $(itemElem).data('date');
                        return parseFloat(date);
                    },
                },
                sortBy: 'date',
                sortAscending: true
            });
            break;
        case 'date_high':
            $container.isotope({
                getSortData: {
                    date: function(itemElem) {
                        var date = $(itemElem).data('date');
                        return parseFloat(date);
                    },
                },
                sortBy: 'date',
                sortAscending: false
            });
            break;
        case 'mileage_low':
            $container.isotope({
                getSortData: {
                    mileage: function(itemElem) {
                        var mileage = $(itemElem).data('mileage');
                        return parseFloat(mileage);
                    }
                },
                sortBy: 'mileage',
                sortAscending: true
            });
            break;
        case 'mileage_high':
            $container.isotope({
                getSortData: {
                    mileage: function(itemElem) {
                        var mileage = $(itemElem).data('mileage');
                        return parseFloat(mileage);
                    }
                },
                sortBy: 'mileage',
                sortAscending: false
            });
            break;
        case 'distance':
            $container.isotope({
                getSortData: {
                    distance: function(itemElem) {
                        var distance = $(itemElem).data('distance');
                        return parseFloat(distance);
                    }
                },
                sortBy: 'distance',
                sortAscending: true
            });
            break;
        default:
    }
    $container.isotope('updateSortData').isotope();
}
