function stm_get_price_view(price, currency, currencyPos, priceDel) {
    return price;
    var stmText = '';
    if (currencyPos == 'left') {
        stmText += currency;
        stmText += price.toString().replace(/\B(?=(\d{3})+(?!\d))/g, priceDel);
    } else {
        stmText += price.toString().replace(/\B(?=(\d{3})+(?!\d))/g, priceDel);
        stmText += currency;
    }
    return stmText;
};
